import * as React from 'react';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import { Container, Paper, Button } from '@mui/material';

export default function Security() {
    const paperStyle ={padding:'50px 20px', width:600, margin:"20px auto"}
    const[nume,setNume] = React.useState('')
    const[prenume,setPrenume] = React.useState('')
    const[email,setEmail] = React.useState('')
    const[password,setPassword] = React.useState('')

    const handleClick=(e)=>{
        e.preventDefault()
        const user = {nume,prenume,email,password}
        console.log(user)
    }
    
  return (
    <Box
      component="form"
      sx={{
        '& > :not(style)': { m: 1},
      }}
      noValidate
      autoComplete="off"
    >
        <form>
    <Container>
        <Paper elevation={3} style={paperStyle}>
            <h1>Register</h1>
      <TextField id="outlined-basic" label="Nume" variant="outlined" fullWidth
      value={nume}
      onChange={(e)=>setNume(e.target.value)}
      />
      <TextField id="outlined-basic" label="Prenume" variant="outlined" fullWidth
      value={prenume}
      onChange={(e)=>setPrenume(e.target.value)}
      />
      <TextField id="outlined-basic" label="Email" variant="outlined" fullWidth
      value={email}
      onChange={(e)=>setEmail(e.target.value)}
      />
      <TextField id="outlined-basic" label="Parola" variant="outlined" fullWidth
      value={password}
      onChange={(e)=>setPassword(e.target.value)}
      />
      <Button variant="contained" onClick={handleClick}>Submit</Button>
        </Paper>
    </Container>
    </form>
    </Box>
  );
}
